import React from "react";
import { Button, StyleSheet, Text, View } from "react-native";

function News() {
  return (
    <View>
      <Text>This is News page</Text>
      <Button title="News" onPress={() => navigation.navigate("News")} />
    </View>
  );
}

export default News;
